// ForexRates.js

import React, { useState, useEffect } from 'react';
import BackendApi from '../api/BackendApi'; // Adjust path as per your project structure

const ForexRates = () => {
  const [rates, setRates] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchForexRates = async () => {
      try {
        const rates = await BackendApi.getForexRates('2012-09-05'); // Adjust date as needed
        setRates(rates);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching forex rates:', error);
        setLoading(false);
      }
    };

    fetchForexRates();
  }, []);

  return (
    <div>
      <h2>Exchange Rates for USD on 2012-09-05</h2>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <ul>
          {Object.keys(rates).map(currency => (
            <li key={currency}>
              {currency}: {rates[currency]}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default ForexRates;
